function App() {

  return (
    <div className="container my-5">
      <h1 className="display-3">Todo App</h1>
      <TaskForm onSubmitFunction = {addTask} />
      <div className="text-primary">
        <hr/>
      </div>        
      <div>
        {
          taskList.map((task, index) => {
            return (<TaskCard 
                      key={index}
                      task={task}       
                      getTask={getTask}
                      updateTask={updateTask}                
                    /> 
                    );
            }
          )
        }
      </div>
    </div>
  );
}

export default App;
